import React, { Component } from 'react';

class Resume extends Component {
    render(){
        return (
            <div>
               <h1>Development tools summary</h1>
               <h2>Methods</h2>
               <p>Object-oriented design, Agile development, Test-driven development (TDD), MVC</p>
               <h2>Technologies (in order of fluency)</h2>
               <p>Java, TypeScript, Angular, JavaScript, C#, .NET, HTML/CSS, Bootstrap, Razor, Entity, 
                   JUnit, PyUnit, SQL Server, Karma/Jasmine, Python, Spring Boot Java, React, C, C++, ROS, XML, Firebase</p>

            </div>
        );
    }
}

export default Resume;
